import React from 'react';

function QuoteText(props) {
  return (
    <div>
      <div id="text" style={{borderStyle: "solid"}}>
        <p>
          {props.quote}
        </p>
      </div>
      <div id="author" style={{borderStyle: "solid"}}>
        <p>
          {props.author}
        </p>
      </div>
    </div>
  );
}

export default QuoteText;
